import React from 'react';
import './App.css';

export const App = () => {
  return (
  <>
    <div>
      <input placeholder='TODOを入力'/>
      <button>追加</button>
    </div>
    <div>
      <p>未完了のTODO</p>
      <ul>
        <li>First Todo</li>
        <button>完了</button>
        <button>削除</button>
      </ul>
    </div>
    <div></div>
  </>
  );
};
